column188:
The Service to be provided includes a range of arboricultural maintenance and tree planting within the Borough including but not limited to: 
	Highway land;
	Parks & open spaces;
	Cemeteries & allotments;
	Woodlands; and
	Housing estates. 
The Authority operates a 3 (three) year cyclical inspection and maintenance regime of the 19,000 (nineteen thousand) highway trees. Monthly reactive, urgent and emergency works are issued as required.  In addition, annual epicormic removal and  canopy lifts are required for approximately 500 (five hundred) trees and biennial pollarding of approximately 500 (five hundred) London planes.
The majority (if not all) of parks are also expected to require maintenance works during the Term.   
The Service includes the supply, planting and maintenance of trees as required. This will be as discussed, agreed and directed by the Authority from time to time.
Works categories (including but not limited to):
	Planned cyclical Ward maintenance (with "Ward" being the respective area that elected members are elected to);
	Monthly reactive works batches;
	Urgent works;
	Emergency works; and
	Planting of new trees (of which species will be prescribed by the Authority).
